import { combineReducers } from "redux";
import clientReducer from "./clientReducer";
import commonReducer from "./commonReducer";
import caregiverReducer from "./caregiverReducer";
import careManagerReducer from "./careManagerReducer";
import physicalTherapistReducer from "../reducers/physicalTherapistReducer";
import nurseReducer from "../reducers/nurseReducer";
import dashboardReducer from "./dashboardReducer";

export default combineReducers({
  dashboard: dashboardReducer,
  client: clientReducer,
  common: commonReducer,
  caregiver: caregiverReducer,
  careManager: careManagerReducer,
  physicalTherapist: physicalTherapistReducer,
  nurse: nurseReducer
});
